Debt and loan is always a relationship of several parties. Participants have to calculate the remaining debt and remember all operations. If someone makes a mistake in the calculations, there will be a misunderstanding. Create a debt in Saldo and you will forget about disagreements in financial matters. You will no longer have to remember how much you borrowed, how much you returned, and how much you still owe.

With this app, any action, such as changing the amount of debt or paying off interest, is only performed with the consent of both parties. All operations are saved in the payment history and displayed for each participant. Participants ' personal data is protected at every stage.

If interest is accrued, this information will also be recorded by all participants. If you change the amount of debt for the billing period, interest will be calculated separately for each period.

App features:
- Monthly accrual of interest;
- Partial repayment of debt and interest;
- Debt management;
- More than 100 currencies;
- Debt and interest statistics for the selected period;
- No need for registration;
- Anonymous transactions for all parties;
- Privacy of personal data;

“Saldo” debts is the most convenient tool for managing financial issues.

